import { useState, useCallback } from "react";

const useHttp = async () => {
  const response = await fetch(
    "https://swapi.dev/api/films"
  );
  console.log(response);
  if (!response.ok) {
    throw new Error("Something went wrong!");
  }

  const data = await response.json();
  console.log(data);
};

export default useHttp;
